import { useLocation } from 'react-router-dom';
import './TelaAndar.css'

function TelaAndar(){
    const location = useLocation();
   var local = location.state.id
   console.log(local)
   var teste = []
   for(var x=0; x<local[1]; x++){
        teste.push(x)
    }
return(
    <div className='TelaAndar'>
    <div className='Estante'>
    
    {teste.map((i)=>{
        if(i==local[0].floor-1){
            return(
                <h1>ee</h1>
                )        
        }else{
            return(
            <h1>aaa</h1>
                )
        }
        
    })}

    </div>    
    </div>
)
}
export default TelaAndar;
